  <div>
      <HashRouter>
        <Switch>
          {/* <Route path="/ShowPicture/:id" component={ShowPicture} /> */}
          <Route component={Main} />{/* 默认组件：老师界面*/}
        </Switch>
      </HashRouter>
  </div>,
